void *reader(void *arg)
{
    int id, i;
    id = *(int *)arg;

    while (1) {
        sem_wait(queue);  // reader 를 큐에 넣어준다.
        sem_wait(read_mutex);
        // Entry Section 에 들어가기 전에 다른 reader 가 접근하지 못하도록 락을 건다.
        read_count ++;
        if(read_count == 1) sem_wait(resource);
        sem_post(read_mutex);
        sem_post(queue);
        /*
         * Begin Critical Section
         */
        printf("<");
        for (i = 0; i < N; ++i)
            printf("%c", 'A'+id);
        printf(">");
        /* 
         * End Critical Section
         */
        sem_wait(read_mutex);
        read_count --;
        if(read_count == 0) sem_post(resource);
        sem_post(read_mutex);
    }
    pthread_exit(0);
}

void *writer(void *arg)
{
    int id, i;
    struct timespec req, rem;

    id = *(int *)arg;
    req.tv_sec = 0;
    req.tv_nsec = 100000000L;

    while (1) {
        sem_wait(queue);
        sem_wait(resource);
        sem_post(queue);
        /*
         * Begin Critical Section
         */
        printf("\n");
        if (id == 0)
            for (i = 0; i < L; ++i)
                printf("%s\n", t[i]);
        else
            for (i = 0; i < M; ++i)
                printf("%s\n", d[i]);
        /* 
         * End Critical Section
         */
        sem_post(resource);
        nanosleep(&req, &rem);
    }
    pthread_exit(0);
}

int main(void)
{
    int i;
    int rarg[RNUM], warg[WNUM];
    pthread_t rthid[RNUM];
    pthread_t wthid[WNUM];
    pthread_attr_t attr;
    struct timespec req, rem;
    resource = sem_open("resource", O_CREAT, 0644, 1);
    read_mutex = sem_open("read_mutex", O_CREAT, 0644, 1);
    queue = sem_open("queue", O_CREAT, 0644, 1);
    
    /*
     * Initialize thread attributes
     */
    if (pthread_attr_init(&attr) != 0) {
            fprintf(stderr, "pthread_init error\n");
            exit(-1);
    }
    /* 
     * Create RNUM reader threads
     */
    for (i = 0; i < RNUM; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, &attr, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-2);
        }
    }
    /* 
     * Create WNUM writer threads
     */
    for (i = 0; i < WNUM; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, &attr, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-2);
        }
    }
    /* 
     * Wait for 0.5 second and terminate
     */
    req.tv_sec = 3;
    req.tv_nsec = 500000000L;
    
    // sem_close(resource);
    // sem_close(mutex);
    nanosleep(&req, &rem);
    sem_unlink("resource");
    sem_unlink("read_mutex");
    sem_unlink("queue");
    
    
    exit(0);
}